import React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import CreateRecipe from './components/recipes/CreateRecipe'
import EditRecipe from './components/recipes/EditRecipe'
import RecipeList from './components/recipes/RecipeList'
import RecipeInfo from './components/recipes/RecipeInfo'
import Home from '../src/components/pages/Home'

function App() {
  return (
    <div className="App">
    <Router>
      <Navigation />
      <div>
        <Main />
      </div>      
    </Router>
    </div>
  )
}
 function Navigation(){
   return (
    <nav>
      <Link to={'/'}>Home</Link>
      <Link to={'/recipes'}>Recipes</Link>
    </nav>
   )
 }

 function Main(){
   return(
    <Routes>
      <Route exact path='/' component={Home} />
      <Route exact path="/recipes" component={RecipeList} />
      <Route exact path="/recipes/new" component={CreateRecipe} />
      <Route exact path="/recipes/:_id" component={RecipeInfo} />
      <Route exact path="/recipes/:_id/edit" component={EditRecipe} />        
    </Routes>
   )
 }
export default App;
